package com.ja.shape.vo;

public class BigCategoryVo {

	private int no;
	private String big_name;
	
	public BigCategoryVo() {
		// TODO Auto-generated constructor stub
	}

	public BigCategoryVo(int no, String big_name) {
		super();
		this.no = no;
		this.big_name = big_name;
	}

	public int getNo() {
		return no;
	}

	public void setNo(int no) {
		this.no = no;
	}

	public String getBig_name() {
		return big_name;
	}

	public void setBig_name(String big_name) {
		this.big_name = big_name;
	}
	
	
	
}
